        { title: 'Alpine Meadow', description: 'Wildflowers blanket mountain slopes', image: 'https://images.pexels.com/photos/1666021/pexels-photo-1666021.jpeg?auto=compress&cs=tinysrgb&w=400' },
        { title: 'Glacier Ice', description: 'Ancient frozen rivers of time', image: 'https://images.pexels.com/photos/753325/pexels-photo-753325.jpeg?auto=compress&cs=tinysrgb&w=400' }
