        { title: 'Data Analytics', description: 'Insights that drive decisions', image: 'https://images.pexels.com/photos/590022/pexels-photo-590022.jpeg?auto=compress&cs=tinysrgb&w=400' },
        { title: 'AI Solutions', description: 'Intelligence meets automation', image: 'https://images.pexels.com/photos/8386440/pexels-photo-8386440.jpeg?auto=compress&cs=tinysrgb&w=400' },
