        { title: 'Mobile Apps', description: 'Apps that users love', image: 'https://images.pexels.com/photos/887751/pexels-photo-887751.jpeg?auto=compress&cs=tinysrgb&w=400' },
        { title: 'Web Platforms', description: 'Robust online experiences', image: 'https://images.pexels.com/photos/270373/pexels-photo-270373.jpeg?auto=compress&cs=tinysrgb&w=400' },
